import React from 'react';

import './App.css';
import Routes from './routes';
import incorrect from './assets/incorrect.ogg';


function App() {
  return (
    <div className="container">
      <audio id="incorrect" src={incorrect}></audio>
      <div className="content">
        <Routes />
      </div>
    </div>
  );
}

export default App;
